    <div className="navigation">
      <div className="navbar navbar_type_desktop">
        <Route path="/sign-in">
          <Link
            className="navigation__link navigation__link-signup"
            to="/sign-up"
          >
            Регистрация
          </Link>
        </Route>
        <Link
          className="navigation__link navigation__link-signup"
          to="/sign-in"
        >
          Войти
        </Link>
      </div>
    </div>
  );
};

export default Navigation;
